snippet.description:
Ci siamo! Dopo tanta attesa e tanto hype è finalmente disponibile Mafia The Old Country (Terra Madre in italiano). Il nuovo capitolo di questa celebre serie, a cura di Hangar 13, ci avrà convinto appieno? Scopritelo guardando questa recensione che ho curato particolarmente e che, a prescindere dal giudizio sul gioco, mi rende orgoglioso per... più di un motivo!

Versione recensita: PC (di fascia altissima)

INDICE DEGLI ARGOMENTI:0:00 - Intro;
0:51 - Analisi della TRAMA (no spoiler);
4:29 - GAMEPLAY;
4:43 - Mappa di gioco e varietà delle ambientazioni;
6:18 - Esplorazione;
6:45 - Varietà delle missioni;
7:31 - Fasi stealth e problemi di IA;
8:48 - Shooting e sezioni di combat con armi da fuoco;
9:31 - Combattimento con il coltello 1vs1;
11:11 - Gare a cavallo e in auto;
11:45 - Guida e esplorazione con i veicoli e i cavalli;
12:07 - Potenziamenti (ornamenti) e oggetti acquistabili;
13:18 - Più forma che sostanza? Un prodotto eccessivamente derivativo;
14:12 - GRAFICA & SONORO;
16:03 - Caricamenti piuttosto lunghi;
16:15 - Musiche, effetti sonori e doppiaggio siciliano;
18:46 - Piccolo annuncio che ci rende orgogliosi;
21:06 - VOTO, PRO E CONTRO;
21:15 - CONCLUSIONI FINALI;
22:45 - Considerazioni soggettive e saluti.

